// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";

contract ClientContract {
  using Counters for Counters.Counter;

  /**
  * @dev Contract Configuration
  */
  struct Config {
    address ownerAdress;
    address customerAddress;
    address prevContract;
    address nextContract;
    bytes6 version;
    uint48 datePrevContract;
    uint48 nextPrevContract;
  }

  // struct mesure en-tête (28) { 
  //   //V0.1
  //   Version : bytes6;
  //   Date : YYYYmmddHHii : byte12
  //   Type de mesureID : bytes6 - CODE : 3 chiffre/lettre pour la nature physique - 3 chiffre/lettre pour la version
  //   Type temporel : bytes1 (Horaire, Journalier) Y m d H i
  //   Nb temporel : bytes2
  //   Type isAlerte : bytes1 
  // }

 // struct mesure donnée (32) { 
  //   Valeur Max : bytes8
  //   Valeur Moyenne : bytes8
  //   Valeur Médiane : bytes8
  //   Valeur Min : bytes8
  // }

  struct Service {
    bytes6 version;
    string description;
    bytes6 tempCode;
    uint8 nbTemp;
    bool isActive;
    Counters.Counter measureIdCounter;
  }

  Counters.Counter private _serviceIdCounter;
  Service[] public services;
  mapping(uint => bytes28[]) public serviceHeaderMeasures;
  mapping(uint => bytes32[]) public serviceBodyMeasures;

  constructor () {

  }

  function addService(
    bytes6 _version,  
    string memory _description,
    bytes6 _tempCode,
    uint8 _nbTemp) external{

    Counters.Counter memory measureIdCounter;

    services[_serviceIdCounter.current()] = Service(
      _version, 
      _description, 
      _tempCode, 
      _nbTemp,
      true,
      measureIdCounter);

    _serviceIdCounter.increment();
  }  

  function getService(
    uint _service_id) external view returns(
      bytes6 version, 
      string memory description, 
      bytes6 tempCode, 
      uint8 nbTemp,
      bool isActive,
      uint256 measureIdCounter){

      return (
          services[_service_id].version,
          services[_service_id].description,
          services[_service_id].tempCode,
          services[_service_id].nbTemp,
          services[_service_id].isActive,
          services[_service_id].measureIdCounter.current()                 
      );
  }


  function addMeasure(
    uint _serviceId,
    bytes28 _measureHeader,
    bytes32 _measurebody) external {

    serviceHeaderMeasures[_serviceId].push(_measureHeader);
    serviceBodyMeasures[_serviceId].push(_measurebody);
  }


}
